import faker from 'faker';

const expertList = [
    {
        "key":0,
        "avatar": faker.image.avatar(),
        "name": `${faker.name.firstName()} ${faker.name.lastName()}`,
        "Position": faker.name.jobTitle(),
        "description": faker.company.catchPhraseDescriptor()
    }
]
